import React from "react";

function BotCollection({bots}) {
  // Your code here
  return (
    <div className="ui four column grid">
      <div className="row">
        Collection of all bots
        {bots.map(bot => {
          return (
            <div>
              <h6>{bot.name}</h6>
              <img src={bot.avat} alt="" />
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default BotCollection;
